, source = "mash1na", sound = "talent.season10.241732595.1" }, talent_10_241732595_voice_2 = { label = "Музыкальная пауза.", message = "Музыкальная пауза. Воу-воу-воу-воу-воу-воу-воу-воу-воу.", translation = "#DOTA_talent_chatwheel_message_10_241732595_voice_2", source = "mash1na", sound = "talent.season10.241732595.2" }, talent_10_159020918_voice_1 = { label = "Кого? Чего?", message = "Кого? Чего?", translation = "#DOTA_talent_chatwheel_message_10_159020918_voice_1", source = "RodjER", sound = "talent.season10.159020918.1" }, talent_10_159020918_voice_2 = { label = "Literally unkillable.", message = "Literally unkillable.", translation = "#DOTA_talent_chatwheel_message_10_159020918_voice_2", source = "RodjER", sound = "talent.season10.159020918.2" }, talent_10_80542879_voice_1 = { label = "Зря... Ой, зря!", message = "Зря... Ой, зря!", translation = "#DOTA_talent_chatwheel_message_10_80542879_voice_1", source = "Adekvat", sound = "talent.season10.80542879.1" }, talent_10_80542879_voice_2 = { label = "Поворачиваем на 180 градусов...", message = "Поворачиваем на 180 градусов и алга!", translation = "#DOTA_talent_chatwheel_message_10_80542879_voice_2", source = "Adekvat", sound = "talent.season10.80542879.2" }, talent_10_76271205_voice_1 = { label = "Фух... Зачиллься, кореш.", message = "Фух... Зачиллься, кореш.", translation = "#DOTA_talent_chatwheel_message_10_76271205_voice_1", source = "ArsZeeqq", sound = "talent.season10.76271205.1" }, talent_10_76271205_voice_2 = { label = "Да, ребят, просто восторг!", message = "Да, ребят, просто восторг!", translation = "#DOTA_talent_chatwheel_message_10_76271205_voice_2", source = "ArsZeeqq", sound = "talent.season10.76271205.2" }, talent_10_178638015_voice_1 = { label = "Братишка, ну что ты притих?!", message = "Братишка, ну что ты притих?!", translation = "#DOTA_talent_chatwheel_message_10_178638015_voice_1", source = "Mantis", sound = "talent.season10.178638015.1" }, talent_10_178638015_voice_2 = { label = "Другалёчек, зачиллься.", message = "Другалёчек, зачиллься.", translation = "#DOTA_talent_chatwheel_message_10_178638015_voice_2", source = "Mantis", sound = "talent.season10.178638015.2" }, talent_10_123787524_voice_1 = { label = "Ух, тяжело.", message = "Ух, тяжело.", translation = "#DOTA_talent_chatwheel_message_10_123787524_voice_1", source = "Shachlo", sound = "talent.season10.123787524.1" }, talent_10_123787524_voice_2 = { label = "А что это вы делаете...", message = "А что это вы делаете у меня на линии?", translation = "#DOTA_talent_chatwheel_message_10_123787524_voice_2", source = "Shachlo", sound = "talent.season10.123787524.2" }, talent_10_86918872_voice_1 = { label = "Call an ambulance!", message = "Oh, call an ambulance! Call an ambulance! But not for me.", translation = "#DOTA_talent_chatwheel_message_10_86918872_voice_1", source = "Bkop", sound = "talent.season10.86918872.1" }, talent_10_86918872_voice_2 = { label = "Take this time to wash your face.", message = "Why don't you take this time to wash your face? Ok?", translation = "#DOTA_talent_chatwheel_message_10_86918872_voice_2", source = "Bkop", sound = "talent.season10.86918872.2" }, talent_10_87264171_voice_1 = { label = "Oh, my God! Wow!", message = "Oh, my God! Wow!", translation = "#DOTA_talent_chatwheel_message_10_87264171_voice_1", source = "Lacoste", sound = "talent.season10.87264171.1" }, talent_10_1013411_voice_1 = { label = "Calm down, it's just a game.", message = "Yo, calm down, it's just a game.", translation = "#DOTA_talent_chatwheel_message_10_1013411_voice_1", source = "BreakyCPK", sound = "talent.season10.1013411.1" }, talent_10_1013411_voice_2 = { label = "It's time to kick ass and chew bubblegum.", message = "It's time to kick ass and chew bubblegum, and I'm all out of gum.", translation = "#DOTA_talent_chatwheel_message_10_1013411_voice_2", source = "BreakyCPK", sound = "talent.season10.1013411.2" }, talent_10_169025618_voice_1 = { label = "Was your dad a mover?", message = "Yo, bro! Was your dad a mover? 'Cause you're carrying all of us.", translation = "#DOTA_talent_chatwheel_message_10_169025618_voice_1", source = "KheZu", sound = "talent.season10.169025618.1" }, talent_10_87177591_voice_1 = { label = "That was great. Good job!", message = "Wow, that was great. Good job!", translation = "#DOTA_talent_chatwheel_message_10_87177591_voice_1", source = "Fear", sound = "talent.season10.87177591.1" }, talent_10_87177591_voice_2 = { label = "You may be a future TI winner.", message = "[yawn] With plays like that, you may be a future TI winner.", translation = "#DOTA_talent_chatwheel_message_10_87177591_voice_2", source = "Fear", sound = "talent.season10.87177591.2" }, talent_10_26231701_voice_1 = { label = "Take that!", message = "Take that! [fighting sounds]", translation = "#DOTA_talent_chatwheel_message_10_26231701_voice_1", source = "T-Panda", sound = "talent.season10.26231701.1" }, talent_10_26231701_voice_2 = { label = "I see you!", message = "I see you!", translation = "#DOTA_talent_chatwheel_message_10_26231701_voice_2", source = "T-Panda", sound = "talent.season10.26231701.2" }, talent_10_665124_voice_1 = { label = "It was a prank, bro!", message = "It was a prank, bro. It was a prank!", translation = "#DOTA_talent_chatwheel_message_10_665124_voice_1", source = "Danog", sound = "talent.season10.665124.1" }, talent_10_665124_voice_2 = { label = "How could this happen to me?", message = "How could this happen to me?", translation = "#DOTA_talent_chatwheel_message_10_665124_voice_2", source = "Danog", sound = "talent.season10.665124.2" }, talent_10_136780564_voice_1 = { label = "Boys, what is up?", message = "Boys, boys, boys. What is up?", translation = "#DOTA_talent_chatwheel_message_10_136780564_voice_1", source = "Ares", sound = "talent.season10.136780564.1" }, talent_10_41475731_voice_1 = { label = "Hah, distraction!", message = "Hah, distraction! Abababibibibububu!", translation = "#DOTA_talent_chatwheel_message_10_41475731_voice_1", source = "Nomad", sound = "talent.season10.41475731.1" }, talent_10_41475731_voice_2 = { label = "Heheh, me no brain.", message = "Heheh, me no brain. Me just hit button.", translation = "#DOTA_talent_chatwheel_message_10_41475731_voice_2", source = "Nomad", sound = "talent.season10.41475731.2" }, talent_10_270293472_voice_1 = { label = "You might actually be the GOAT!", message = "You might actually be the GOAT! Baa! Baa!", translation = "#DOTA_talent_chatwheel_message_10_270293472_voice_1", source = "TeaGuvnor", sound = "talent.season10.270293472.1" }, talent_10_270293472_voice_2 = { label = "The game is rough. But it's gonna be OK!", message = "The creeps are dying, we have no vision, the game is rough. But it's gonna be OK!", translation = "#DOTA_talent_chatwheel_message_10_270293472_voice_2", source = "TeaGuvnor", sound = "talent.season10.270293472.2" }, talent_10_87024653_voice_1 = { label = "We don't care!", message = "Hahahaha, we don't care. We don't care!", translation = "#DOTA_talent_chatwheel_message_10_87024653_voice_1", source = "MLPDotA", sound = "talent.season10.87024653.1" }, talent_10_37899842_voice_1 = { label = "This guy knows what he is doing.", message = "Hahaha, this guy totally knows what he is doing.", translation = "#DOTA_talent_chatwheel_message_10_37899842_voice_1", source = "johnxfire", sound = "talent.season10.37899842.1" }, talent_10_181866849_voice_1 = { label = "Not what was supposed to happen!", message = "That was not what was supposed to happen!", translation = "#DOTA_talent_chatwheel_message_10_181866849_voice_1", source = "Moxxi", sound = "talent.season10.181866849.1" }, talent_10_181866849_voice_2 = { label = "Hehehehehe.", message = "Hehehehehe.", translation = "#DOTA_talent_chatwheel_message_10_181866849_voice_2", source = "Moxxi", sound = "talent.season10.181866849.2" }, talent_10_37147003_voice_1 = { label = "Oh, thank you!", message = "Oh, thank you!", translation = "#DOTA_talent_chatwheel_message_10_37147003_voice_1", source = "Sheever", sound = "talent.season10.37147003.1" }, talent_10_37147003_voice_2 = { label = "Oops! Did I do that?", message = "Oh, oops! Did I do that?", translation = "#DOTA_talent_chatwheel_message_10_37147003_voice_2", source = "Sheever", sound = "talent.season10.37147003.2" }, talent_10_242846025_voice_1 = { label = "I certainly didn't deserve that!", message = "I don't know what I did in the past life, but I certainly didn't deserve that!", translation = "#DOTA_talent_chatwheel_message_10_242846025_voice_1", source = "NatTea", sound = "talent.season10.242846025.1" }, talent_10_242846025_voice_2 = { label = "Tag, you're it!", message = "Tag, you're it!", translation = "#DOTA_talent_chatwheel_message_10_242846025_voice_2", source = "NatTea", sound = "talent.season10.242846025.2" }, talent_10_9332911_voice_1 = { label = "How is that balanced?", message = "How is that balanced?", translation = "#DOTA_talent_chatwheel_message_10_9332911_voice_1", source = "Pyrion Flax", sound = "talent.season10.9332911.1" }, talent_10_9332911_voice_2 = { label = "Help!", message = "Help!", translation = "#DOTA_talent_chatwheel_message_10_9332911_voice_2", source = "Pyrion Flax", sound = "talent.season10.9332911.2" }, talent_10_97577101_voice_1 = { label = "Two Dota players in a lane.", message = "Two Dota players in a lane. They might kiss!", translation = "#DOTA_talent_chatwheel_message_10_97577101_voice_1", source = "Sheepsticked", sound = "talent.season10.97577101.1" }, talent_10_97577101_voice_2 = { label = "Who do you think you are? I am!", message = "Who do you think you are? I am!", translation = "#DOTA_talent_chatwheel_message_10_97577101_voice_2", source = "Sheepsticked", sound = "talent.season10.97577101.2" }, talent_10_95145869_voice_1 = { label = "Daddy, chill!", message = "Daddy, chill!", translation = "#DOTA_talent_chatwheel_message_10_95145869_voice_1", source = "Jenkins", sound = "talent.season10.95145869.1" }, talent_10_95145869_voice_2 = { label = "What the hell is even that?", message = "What the hell is even that?", translation = "#DOTA_talent_chatwheel_message_10_95145869_voice_2", source = "Jenkins", sound = "talent.season10.95145869.2" }, talent_10_86725175_voice_1 = { label = "I will carry this game.", message = "Don't worry, guys. I will carry this game.", translation = "#DOTA_talent_chatwheel_message_10_86725175_voice_1", source = "Resolution", sound = "talent.season10.86725175.1" }, talent_10_196628643_voice_1 = { label = "That may have been a mistake.", message = "Uh-oh. That may have been a mistake.", translation = "#DOTA_talent_chatwheel_message_10_196628643_voice_1", source = "Ephey", sound = "talent.season10.196628643.1" }, talent_10_196628643_voice_2 = { label = "Oh, poor baby.", message = "Oh, poor baby.", translation = "#DOTA_talent_chatwheel_message_10_196628643_voice_2", source = "Ephey", sound = "talent.season10.196628643.2" }, talent_10_256125365_voice_1 = { label = "Impressed by your unique approach.", message = "I'm impressed by your unique approach.", translation = "#DOTA_talent_chatwheel_message_10_256125365_voice_1", source = "Purge", sound = "talent.season10.256125365.1" }, talent_10_256125365_voice_2 = { label = "I did not see that one coming.", message = "I did not see that one coming.", translation = "#DOTA_talent_chatwheel_message_10_256125365_voice_2", source = "Purge", sound = "talent.season10.256125365.2" }, talent_10_2744346_voice_1 = { label = "I'm so bored.", message = "I'm so bored.", translation = "#DOTA_talent_chatwheel_message_10_2744346_voice_1", source = "tsunami", sound = "talent.season10.2744346.1" }, talent_10_2744346_voice_2 = { label = "I'll be making plays like that all game.", message = "Thank you, thank you. I'll be making plays like that all game.", translation = "#DOTA_talent_chatwheel_message_10_2744346_voice_2", source = "tsunami", sound = "talent.season10.2744346.2" }, talent_10_5448108_voice_1 = { label = "Not bad. Not bad at all.", message = "Not bad. Not bad at all.", translation = "#DOTA_talent_chatwheel_message_10_5448108_voice_1", source = "Fogged", sound = "talent.season10.5448108.1" }, talent_10_5448108_voice_2 = { label = "Look, look!", message = "Look, look!", translation = "#DOTA_talent_chatwheel_message_10_5448108_voice_2", source = "Fogged", sound = "talent.season10.5448108.2" }, talent_10_690740_voice_1 = { label = "Is this what SUNSfan warned us about?", message = "Is this what SUNSfan warned us about?", translation = "#DOTA_talent_chatwheel_message_10_690740_voice_1", source = "SUNSfan", sound = "talent.season10.690740.1" }, talent_10_4281729_voice_1 = { label = "Who's a good boy?!", message = "Oh, who's a good boy?!", translation = "#DOTA_talent_chatwheel_message_10_4281729_voice_1", source = "syndereN", sound = "talent.season10.4281729.1" }, talent_10_4281729_voice_2 = { label = "So cute! UwU", message = "So cute! UwU", translation = "#DOTA_talent_chatwheel_message_10_4281729_voice_2", source = "syndereN", sound = "talent.season10.4281729.2" }, talent_10_47434686_voice_1 = { label = "Are we still playing?", message = "[snore] Oh, are we still playing?", translation = "#DOTA_talent_chatwheel_message_10_47434686_voice_1", source = "SVG", sound = "talent.season10.47434686.1" }, talent_10_47434686_voice_2 = { label = "Damn! Look at that boy!", message = "Damn! Look at that boy!", translation = "#DOTA_talent_chatwheel_message_10_47434686_voice_2", source = "SVG", sound = "talent.season10.47434686.2" }, talent_10_70090192_voice_1 = { label = "Hah, made you look.", message = "Stack, stack, stack! Hah, made you look.", translation = "#DOTA_talent_chatwheel_message_10_70090192_voice_1", source = "Trent", sound = "talent.season10.70090192.1" }, talent_10_70090192_voice_2 = { label = "Faster way back to the fountain.", message = "Dota is all about efficiency. Dying? Faster way back to the fountain.", translation = "#DOTA_talent_chatwheel_message_10_70090192_voice_2", source = "Trent", sound = "talent.season10.70090192.2" }, talent_10_193673646_voice_1 = { label = "Ooh, no!", message = "Ooh, no!", translation = "#DOTA_talent_chatwheel_message_10_193673646_voice_1", source = "Lyrical", sound = "talent.season10.193673646.1" }, talent_10_193673646_voice_2 = { label = "Ow! Don't do that now.", message = "Ow! Don't do that now.", translation = "#DOTA_talent_chatwheel_message_10_193673646_voice_2", source = "Lyrical", sound = "talent.season10.193673646.2" }, talent_10_112035603_voice_1 = { label = "Winning is so much fun.", message = "Haha, winning is so much fun.", translation = "#DOTA_talent_chatwheel_message_10_112035603_voice_1", source = "Snare", sound = "talent.season10.112035603.1" }, talent_10_112035603_voice_2 = { label = "All part of my plan.", message = "That was all part of my plan.", translation = "#DOTA_talent_chatwheel_message_10_112035603_voice_2", source = "Snare", sound = "talent.season10.112035603.2" }, talent_10_110155287_voice_1 = { label = "I just want to win the game, please.", message = "I just want to win the game, please. Please. Please. Please.", translation = "#DOTA_talent_chatwheel_message_10_110155287_voice_1", source = "lizZard", sound = "talent.season10.110155287.1" }, talent_10_110155287_voice_2 = { label = "I calculated the risk, but the math...", message = "I calculated the risk, but the math's... uh, yes.", translation = "#DOTA_talent_chatwheel_message_10_110155287_voice_2", source = "lizZard", sound = "talent.season10.110155287.2" }, talent_10_86762037_voice_1 = { label = "Pause please. PC out of credit.", message = "Pause, please. Pause please. PC out of credit.", translation = "#DOTA_talent_chatwheel_message_10_86762037_voice_1", source = "WinteR", sound = "talent.season10.86762037.1" }, talent_10_68186278_voice_1 = { label = "That's a Dota play right there!", message = "Yee haw! That's a Dota play right there! Woo, [Marie]!", translation = "#DOTA_talent_chatwheel_message_10_68186278_voice_1", source = "Slacks", sound = "talent.season10.68186278.1" }, talent_10_68186278_voice_2 = { label = "Owwww!", message = "Owwww!", translation = "#DOTA_talent_chatwheel_message_10_68186278_voice_2", source = "Slacks", sound = "talent.season10.68186278.2" }, talent_10_104324194_voice_1 = { label = "Wow~ Awesome!", message = "哇哦~ 好棒棒啊！", translation = "#DOTA_talent_chatwheel_message_10_104324194_voice_1", source = "Tokki", sound = "talent.season10.104324194.1" }, talent_10_104324194_voice_2 = { label = "Huh? You're kidding me!", message = "哈？在逗我呢！", translation = "#DOTA_talent_chatwheel_message_10_104324194_voice_2", source = "Tokki", sound = "talent.season10.104324194.2" }, talent_10_78601976_voice_1 = { label = "I dare you, I double dare you!", message = "I dare you, I double dare you, buyback one more time!", translation = "#DOTA_talent_chatwheel_message_10_78601976_voice_1", source = "Jin", sound = "talent.season10.78601976.1" }, talent_10_78601976_voice_2 = { label = "We are not the same.", message = "Your RNG is pure luck. My RNG is pure skill. We are not the same.", translation = "#DOTA_talent_chatwheel_message_10_78601976_voice_2", source = "Jin", sound = "talent.season10.78601976.2" }, talent_10_123127736_voice_1 = { label = "No, no.", message = "Hm hm, no, no.", translation = "#DOTA_talent_chatwheel_message_10_123127736_voice_1", source = "Tainim", sound = "talent.season10.123127736.1" }, talent_10_123127736_voice_2 = { label = "¡Muere!", message = "¡Muere!", translation = "#DOTA_talent_chatwheel_message_10_123127736_voice_2", source = "Tainim", sound = "talent.season10.123127736.2" }, talent_10_1222248677_voice_1 = { label = "¡Qué buena jugada!", message = "¡Ay, ay ay! ¡Qué buena jugada!", translation = "#DOTA_talent_chatwheel_message_10_1222248677_voice_1", source = "Nela", sound = "talent.season10.1222248677.1" }, talent_10_1222248677_voice_2 = { label = "I'm awesome.", message = "Ya te dije, soy gozu.", translation = "#DOTA_talent_chatwheel_message_10_1222248677_voice_2", source = "Nela", sound = "talent.season10.1222248677.2" }, talent_10_123156879_voice_1 = { label = "Predicciones erroneas.", message = "Cien por cien de predicciones erroneas", translation = "#DOTA_talent_chatwheel_message_10_123156879_voice_1", source = "Necca", sound = "talent.season10.123156879.1" }, talent_10_123156879_voice_2 = { label = "Hasta luego.", message = "Hasta luego, brbrbrbr.", translation = "#DOTA_talent_chatwheel_message_10_123156879_voice_2", source = "Necca", sound = "talent.season10.123156879.2" }, talent_10_198163645_voice_1 = { label = "Nah.", message = "Ja ja ja ja... nah", translation = "#DOTA_talent_chatwheel_message_10_198163645_voice_1", source = "Nois", sound = "talent.season10.198163645.1" }, talent_10_198163645_voice_2 = { label = "No entiendo.", message = "Yo no entiendo, no entiendo.", translation = "#DOTA_talent_chatwheel_message_10_198163645_voice_2", source = "Nois", sound = "talent.season10.198163645.2" }, talent_10_125455301_voice_1 = { label = "¿Y ahora?", message = "Ya papi, ¿y ahora?", translation = "#DOTA_talent_chatwheel_message_10_125455301_voice_1", source = "MiHawk", sound = "talent.season10.125455301.1" }, talent_10_59690707_voice_1 = { label = "Voltis", message = "¡Wow, wow, wow! ¡Se viene la voltis!", translation = "#DOTA_talent_chatwheel_message_10_59690707_voice_1", source = "Er-Kratos", sound = "talent.season10.59690707.1" }, talent_10_59690707_voice_2 = { label = "Decisión dudosa.", message = "Esa decisión es cuanto menos... ¿dudosa?", translation = "#DOTA_talent_chatwheel_message_10_59690707_voice_2", source = "Er-Kratos", sound = "talent.season10.59690707.2" }, talent_10_314468507_voice_1 = { label = "Remontada.", message = "Ay, ay, ay, the comback is real.", translation = "#DOTA_talent_chatwheel_message_10_314468507_voice_1", source = "TaO", sound = "talent.season10.314468507.1" }, talent_10_314468507_voice_2 = { label = "I don't know, crazy game.", message = "I don't know what is happening in this game, it's crazy.", translation = "#DOTA_talent_chatwheel_message_10_314468507_voice_2", source = "TaO", sound = "talent.season10.314468507.2" }, talent_10_121604932_voice_1 = { label = "Lo intentamos.", message = "Bueno, lo intentamos.", translation = "#DOTA_talent_chatwheel_message_10_121604932_voice_1", source = "Maverick", sound = "talent.season10.121604932.1" }, talent_10_121604932_voice_2 = { label = "Solo un juego.", message = "Tranqui mi bro, es solo un juego.", translation = "#DOTA_talent_chatwheel_message_10_121604932_voice_2", source = "Maverick", sound = "talent.season10.121604932.2" }, talent_10_128947109_voice_1 = { label = "Dota todo el día.", message = "Dota,Dota Dota,todo el día Dota.", translation = "#DOTA_talent_chatwheel_message_10_128947109_voice_1", source = "Tio Inka", sound = "talent.season10.128947109.1" }, talent_10_116326606_voice_1 = { label = "¡Se acabó!", message = "¡Se acabó, se acabó, se acabó!", translation = "#DOTA_talent_chatwheel_message_10_116326606_voice_1", source = "Giulio", sound = "talent.season10.116326606.1" }, talent_10_116326606_voice_2 = { label = "Welcome to Dota", message = "Welcome to the Defense of the Ancients", translation = "#DOTA_talent_chatwheel_message_10_116326606_voice_2", source = "Giulio", sound = "talent.season10.116326606.2" }, talent_10_40936819_voice_1 = { label = "Commend.", message = "Commend, commend, commend, commend, commend, commend, commend.", translation = "#DOTA_talent_chatwheel_message_10_40936819_voice_1", source = "Blue", sound = "talent.season10.40936819.1" }, talent_10_40936819_voice_2 = { label = "¿Qué más quieres?", message = "¿Qué más quieres? ¿Ya pa'qué más?", translation = "#DOTA_talent_chatwheel_message_10_40936819_voice_2", source = "Blue", sound = "talent.season10.40936819.2" }, talent_10_74378317_voice_1 = { label = "Tranquilo papi.", message = "Tranquilo papi, ¿qué intentas?", translation = "#DOTA_talent_chatwheel_message_10_74378317_voice_1", source = "Flapjack", sound = "talent.season10.74378317.1" }, talent_10_74378317_voice_2 = { label =