 = "大哥让我一波线，求求了", translation = "#DOTA_talent_chatwheel_message_10_246523528_voice_2", source = "白坚强", sound = "talent.season10.246523528.2" }, talent_10_111189717_voice_1 = { label = "我问心无愧", message = "我问心无愧", translation = "#DOTA_talent_chatwheel_message_10_111189717_voice_1", source = "Inflame", sound = "talent.season10.111189717.1" }, talent_10_111189717_voice_2 = { label = "要不你来？", message = "要不你来？", translation = "#DOTA_talent_chatwheel_message_10_111189717_voice_2", source = "Inflame", sound = "talent.season10.111189717.2" }, talent_10_103039499_voice_1 = { label = "怎么说？怎么说？", message = "怎么说？怎么说？怎么说？", translation = "#DOTA_talent_chatwheel_message_10_103039499_voice_1", source = "super", sound = "talent.season10.103039499.1" }, talent_10_103039499_voice_2 = { label = "尊嘟假嘟？", message = "尊嘟假嘟？", translation = "#DOTA_talent_chatwheel_message_10_103039499_voice_2", source = "super", sound = "talent.season10.103039499.2" }, talent_10_89149892_voice_1 = { label = "你有没有认真打钱?", message = "这么多年了，你有没有认真打钱？", translation = "#DOTA_talent_chatwheel_message_10_89149892_voice_1", source = "BBC", sound = "talent.season10.89149892.1" }, talent_10_89149892_voice_2 = { label = "赢就赢，输就输", message = "赢就赢，输就输，掉不了一点小珍珠", translation = "#DOTA_talent_chatwheel_message_10_89149892_voice_2", source = "BBC", sound = "talent.season10.89149892.2" }, talent_10_125210835_voice_1 = { label = "你在说什么呀", message = "你在说什么呀，听不懂耶", translation = "#DOTA_talent_chatwheel_message_10_125210835_voice_1", source = "CC", sound = "talent.season10.125210835.1" }, talent_10_125210835_voice_2 = { label = "好呀没问题", message = "好呀，好呀好呀没问题的呀，好的呀没问题", translation = "#DOTA_talent_chatwheel_message_10_125210835_voice_2", source = "CC", sound = "talent.season10.125210835.2" }, talent_10_188850333_voice_1 = { label = "啊…？尊嘟假嘟？", message = "啊…？尊嘟假嘟？", translation = "#DOTA_talent_chatwheel_message_10_188850333_voice_1", source = "Dove", sound = "talent.season10.188850333.1" }, talent_10_188850333_voice_2 = { label = "谁还不是个宝宝了", message = "谁还不是个宝宝了", translation = "#DOTA_talent_chatwheel_message_10_188850333_voice_2", source = "Dove", sound = "talent.season10.188850333.2" }, talent_10_87075584_voice_1 = { label = "Аргументированно...", message = "Аргументированно и по фактам.", translation = "#DOTA_talent_chatwheel_message_10_87075584_voice_1", source = "DD", sound = "talent.season10.87075584.1" }, talent_10_87075584_voice_2 = { label = "Вы за кого нас держите?", message = "Вы за кого нас держите?", translation = "#DOTA_talent_chatwheel_message_10_87075584_voice_2", source = "DD", sound = "talent.season10.87075584.2" }, talent_10_144752057_voice_1 = { label = "Легенда!", message = "Легенда!", translation = "#DOTA_talent_chatwheel_message_10_144752057_voice_1", source = "Grayne", sound = "talent.season10.144752057.1" }, talent_10_104433897_voice_1 = { label = "Единственный, кто может меня победить...", message = "Единственный, кто может меня победить — это я сам.", translation = "#DOTA_talent_chatwheel_message_10_104433897_voice_1", source = "JAM", sound = "talent.season10.104433897.1" }, talent_10_206742513_voice_1 = { label = "Да ладно.", message = "Да ладно.", translation = "#DOTA_talent_chatwheel_message_10_206742513_voice_1", source = "Santa", sound = "talent.season10.206742513.1" }, talent_10_206742513_voice_2 = { label = "У меня нет всего, что я люблю...", message = "У меня нет всего, что я люблю, но я люблю всё, что у меня есть.", translation = "#DOTA_talent_chatwheel_message_10_206742513_voice_2", source = "Santa", sound = "talent.season10.206742513.2" }, talent_10_90324740_voice_1 = { label = "Осторожно, играет профессионал.", message = "Осторожно, играет профессионал.", translation = "#DOTA_talent_chatwheel_message_10_90324740_voice_1", source = "Lasther0-", sound = "talent.season10.90324740.1" }, talent_10_90324740_voice_2 = { label = "Невероятный перформанс...", message = "Невероятный перформанс от этого добряка.", translation = "#DOTA_talent_chatwheel_message_10_90324740_voice_2", source = "Lasther0-", sound = "talent.season10.90324740.2" }, talent_10_350747327_voice_1 = { label = "Пам-парам, пам-парам!", message = "Пам-парам, пам-парам!", translation = "#DOTA_talent_chatwheel_message_10_350747327_voice_1", source = "Sheyl", sound = "talent.season10.350747327.1" }, talent_10_166312089_voice_1 = { label = "А ты смешной.", message = "А ты смешной.", translation = "#DOTA_talent_chatwheel_message_10_166312089_voice_1", source = "EiriteL", sound = "talent.season10.166312089.1" }, talent_10_166312089_voice_2 = { label = "У тебя всё получится.", message = "Не переживай, братик, у тебя всё получится.", translation = "#DOTA_talent_chatwheel_message_10_166312089_voice_2", source = "EiriteL", sound = "talent.season10.166312089.2" }, talent_10_369603517_voice_1 = { label = "Дайте рампагу.", message = "Дайте рампагу.", translation = "#DOTA_talent_chatwheel_message_10_369603517_voice_1", source = "TpoH", sound = "talent.season10.369603517.1" }, talent_10_369603517_voice_2 = { label = "Это новая имба.", message = "Это новая имба.", translation = "#DOTA_talent_chatwheel_message_10_369603517_voice_2", source = "TpoH", sound = "talent.season10.369603517.2" }, talent_10_96196828_voice_1 = { label = "Я просто не понимаю...", message = "Я просто не понимаю, что происходит!", translation = "#DOTA_talent_chatwheel_message_10_96196828_voice_1", source = "633", sound = "talent.season10.96196828.1" }, talent_10_96196828_voice_2 = { label = "Пу-пу-пу...", message = "Пу-пу-пу...", translation = "#DOTA_talent_chatwheel_message_10_96196828_voice_2", source = "633", sound = "talent.season10.96196828.2" }, talent_10_26751577_voice_1 = { label = "Боже, прекрати!", message = "Что ты делаешь? Боже, прекрати!", translation = "#DOTA_talent_chatwheel_message_10_26751577_voice_1", source = "CrystalMay", sound = "talent.season10.26751577.1" }, talent_10_92423451_voice_1 = { label = "Да что вам всем надо?", message = "Да что вам всем надо? Дайте в Доту поиграть!", translation = "#DOTA_talent_chatwheel_message_10_92423451_voice_1", source = "9pasha", sound = "talent.season10.92423451.1" }, talent_10_92423451_voice_2 = { label = "Тихо-тихо-тихо-тихо-тихо.", message = "Тихо-тихо-тихо-тихо-тихо. Помолчите.", translation = "#DOTA_talent_chatwheel_message_10_92423451_voice_2", source = "9pasha", sound = "talent.season10.92423451.2" }, talent_10_404150207_voice_1 = { label = "Тяжело.", message = "Тяжело.", translation = "#DOTA_talent_chatwheel_message_10_404150207_voice_1", source = "y0nd", sound = "talent.season10.404150207.1" }, talent_10_404150207_voice_2 = { label = "Да, было.", message = "В такие моменты надо говорить уверенно: «Да, было».", translation = "#DOTA_talent_chatwheel_message_10_404150207_voice_2", source = "y0nd", sound = "talent.season10.404150207.2" }, talent_10_343774159_voice_1 = { label = "Adiós payasos.", message = "Adiós payasos.", translation = "#DOTA_talent_chatwheel_message_10_343774159_voice_1", source = "Polaris", sound = "talent.season10.343774159.1" }, talent_10_86753880_voice_1 = { label = "Ya pero no te he preguntado.", message = "Ya pero, no te he preguntado.", translation = "#DOTA_talent_chatwheel_message_10_86753880_voice_1", source = "Pawpaw", sound = "talent.season10.86753880.1" }, talent_10_86753880_voice_2 = { label = "Qué gozo, amigo.", message = "Qué gozo, amigo.", translation = "#DOTA_talent_chatwheel_message_10_86753880_voice_2", source = "Pawpaw", sound = "talent.season10.86753880.2" }, talent_10_128947109_voice_2 = { label = "What are you doing?", message = "Eh,eh,eh,eh,¿qué haces?", translation = "#DOTA_talent_chatwheel_message_10_128947109_voice_2", source = "Tio Inka", sound = "talent.season10.128947109.2" }, talent_10_1482324_voice_1 = { label = "Get off the wifi.", message = "Mom get off the wifi I'm lagging.", translation = "#DOTA_talent_chatwheel_message_10_1482324_voice_1", source = "PTP", sound = "talent.season10.1482324.1" }, talent_10_32995405_voice_1 = { label = "This is still winnable.", message = "This is still winnable. Not copium, still winnable.", translation = "#DOTA_talent_chatwheel_message_10_32995405_voice_1", source = "Wagamama", sound = "talent.season10.32995405.1" }, talent_10_32995405_voice_2 = { label = "Nothing of value was lost.", message = "Nothing of value was lost.", translation = "#DOTA_talent_chatwheel_message_10_32995405_voice_2", source = "Wagamama", sound = "talent.season10.32995405.2" }, talent_10_58380135_voice_1 = { label = "It's time for me to go all out!", message = "Huh, looks like it's time for me to go all out! [scream]", translation = "#DOTA_talent_chatwheel_message_10_58380135_voice_1", source = "Cap", sound = "talent.season10.58380135.1" }, talent_10_20796460_voice_1 = { label = "I'm having a great time.", message = "I'm having a great time playing Dota with my friends.", translation = "#DOTA_talent_chatwheel_message_10_20796460_voice_1", source = "Eosin", sound = "talent.season10.20796460.1" }, talent_10_20796460_voice_2 = { label = "I'm going in", message = "I'm going in, I'm going, I'm dead.", translation = "#DOTA_talent_chatwheel_message_10_20796460_voice_2", source = "Eosin", sound = "talent.season10.20796460.2" }, talent_10_125154850_voice_1 = { label = "What is happening?", message = "What is happening?", translation = "#DOTA_talent_chatwheel_message_10_125154850_voice_1", source = "Glem", sound = "talent.season10.125154850.1" }, talent_10_125154850_voice_2 = { label = "Help!", message = "Help! Please Help!", translation = "#DOTA_talent_chatwheel_message_10_125154850_voice_2", source = "Glem", sound = "talent.season10.125154850.2" }, talent_10_2918679_voice_1 = { label = "Stop talking!", message = "Sluta jiddra, börja trolla!", translation = "#DOTA_talent_chatwheel_message_10_2918679_voice_1", source = "skrff", sound = "talent.season10.2918679.1" }, talent_10_2918679_voice_2 = { label = "What are you doing?!", message = "Hörru du, vad håller du på med?", translation = "#DOTA_talent_chatwheel_message_10_2918679_voice_2", source = "skrff", sound = "talent.season10.2918679.2" }, talent_10_55300424_voice_1 = { label = "Not again...", message = "Oh man, not again...", translation = "#DOTA_talent_chatwheel_message_10_55300424_voice_1", source = "Weppas", sound = "talent.season10.55300424.1" }, talent_10_55300424_voice_2 = { label = "Det där gik ju riktigt bra!", message = "Det där gick ju riktigt bra!", translation = "#DOTA_talent_chatwheel_message_10_55300424_voice_2", source = "Weppas", sound = "talent.season10.55300424.2" }, talent_10_87283048_voice_2 = { label = "Нет, ребята... Это кринж.", message = "Нет, ребята... Это кринж.", translation = "#DOTA_talent_chatwheel_message_10_87283048_voice_2", source = "Maelstorm", sound = "talent.season10.87283048.2" }, talent_10_217472313_voice_2 = { label = "Мотивацию надо поднять.", message = "Мотивацию надо поднять.", translation = "#DOTA_talent_chatwheel_message_10_217472313_voice_2", source = "Xakoda", sound = "talent.season10.217472313.2" }, talent_10_113372833_voice_2 = { label = "Ву-ху! Дай пятюню!", message = "Ву-ху! Дай пятюню!", translation = "#DOTA_talent_chatwheel_message_10_113372833_voice_2", source = "UnderShock", sound = "talent.season10.113372833.2" }, talent_10_47701962_voice_2 = { label = "Одна ошибка, и ты ошибся.", message = "Запомни: одна ошибка, и ты ошибся.", translation = "#DOTA_talent_chatwheel_message_10_47701962_voice_2", source = "ZLOBA", sound = "talent.season10.47701962.2" }, talent_10_87264171_voice_2 = { label = "Wait, is this Turbo mode?", message = "Wait, is this Turbo mode?", translation = "#DOTA_talent_chatwheel_message_10_87264171_voice_2", source = "Lacoste", sound = "talent.season10.87264171.2" }, talent_10_169025618_voice_2 = { label = "You so kawaii", message = "You so kawaii~ai~ai~ai~ai", translation = "#DOTA_talent_chatwheel_message_10_169025618_voice_2", source = "KheZu", sound = "talent.season10.169025618.2" }, talent_10_136780564_voice_2 = { label = "We ride or die together.", message = "We ride or die together, brother.", translation = "#DOTA_talent_chatwheel_message_10_136780564_voice_2", source = "Ares", sound = "talent.season10.136780564.2" }, talent_10_87024653_voice_2 = { label = "Everyone calm down.", message = "Yeah, right-o right-o everyone calm down.", translation = "#DOTA_talent_chatwheel_message_10_87024653_voice_2", source = "MLPDotA", sound = "talent.season10.87024653.2" }, talent_10_37899842_voice_2 = { label = "Stop they're already dead!", message = "Stop they're already dead!", translation = "#DOTA_talent_chatwheel_message_10_37899842_voice_2", source = "johnxfire", sound = "talent.season10.37899842.2" }, talent_10_86725175_voice_2 = { label = "You're so funny.", message = "Eheheh... you're so funny.", translation = "#DOTA_talent_chatwheel_message_10_86725175_voice_2", source = "Resolution", sound = "talent.season10.86725175.2" }, talent_10_1084067414_voice_1 = { label = "¡Ay, por dios!", message = "¡Ay, por dios!", translation = "#DOTA_talent_chatwheel_message_10_1084067414_voice_1", source = "Tachas", sound = "talent.season10.1084067414.1" }, talent_10_1084067414_voice_2 = { label = "Welcome", message = "Welcome", translation = "#DOTA_talent_chatwheel_message_10_1084067414_voice_2", source = "Tachas", sound = "talent.season10.1084067414.2" }, talent_10_58380135_voice_2 = { label = "Oh yeah, that was a good one brother!", message = "Oh yeah, that was a good one brother!", translation = "#DOTA_talent_chatwheel_message_10_58380135_voice_2", source = "Cap", sound = "talent.season10.58380135.2" }, talent_10_86762037_voice_2 = { label = "Relax guys, it's just a tactical feed.", message = "Relax guys, it's just a tactical feed.", translation = "#DOTA_talent_chatwheel_message_10_86762037_voice_2", source = "WinteR", sound = "talent.season10.86762037.2" }, talent_10_104196230_voice_2 = { label = "¡Mamita, mamita, jugando mi dotita!", message = "¡Mamita, mamita, jugando mi dotita!", translation = "#DOTA_talent_chatwheel_message_10_104196230_voice_2", source = "Mr.Choco", sound = "talent.season10.104196230.2" }, talent_10_102556298_voice_2 = { label = "¡Pa' tu casa!", message = "¡Pa' tu casa!", translation = "#DOTA_talent_chatwheel_message_10_102556298_voice_2", source = "Dkgamer", sound = "talent.season10.102556298.2" }, talent_10_1112008831_voice_2 = { label = "Te equivocaste de barrio.", message = "Te equivocaste de barrio, brother.", translation = "#DOTA_talent_chatwheel_message_10_1112008831_voice_2", source = "DoRaYaKi", sound = "talent.season10.1112008831.2" }, talent_10_187871574_voice_2 = { label = "Vamoa darle que me sirve.", message = "Vamoa darle que me sirve.", translation = "#DOTA_talent_chatwheel_message_10_187871574_voice_2", source = "Study Caster", sound = "talent.season10.187871574.2" }, talent_10_96877519_voice_2 = { label = "最重要的当然是开心啦", message = "打刀塔嘛，最重要的当然是开心啦", translation = "#DOTA_talent_chatwheel_message_10_96877519_voice_2", source = "Wind", sound = "talent.season10.96877519.2" }, talent_10_182379128_voice_2 = { label = "你别当真啦", message = "刚刚只是施舍一下，你别当真啦", translation = "#DOTA_talent_chatwheel_message_10_182379128_voice_2", source = "Ero", sound = "talent.season10.182379128.2" }, talent_10_113705693_voice_1 = { label = "牛的，兄弟", message = "牛的，兄弟", translation = "#DOTA_talent_chatwheel_message_10_113705693_voice_1", source = "ZSMJ", sound = "talent.season10.113705693.1" }, talent_10_144752057_voice_2 = { label = "Я не злопамятный.", message = "Я не злопамятный. Я запишу.", translation = "#DOTA_talent_chatwheel_message_10_144752057_voice_2", source = "Grayne", sound = "talent.season10.144752057.2" }, talent_10_104433897_voice_2 = { label = "Ведь я абсолют и вижу всё.", message = "Ведь я абсолют и вижу всё.", translation = "#DOTA_talent_chatwheel_message_10_104433897_voice_2", source = "JAM", sound = "talent.season10.104433897.2" }, talent_10_350747327_voice_2 = { label = "Как дела?", message = "Как дела?", translation = "#DOTA_talent_chatwheel_message_10_350747327_